import {useNavigate} from 'react-router-dom';
import { useForm } from 'react-hook-form';
import classes from './fabricform.module.css';


const FabricForm=({onSubmit})=>{
const {
    register,
    handleSubmit,
    formState: { errors, isSubmitting },
    reset
  } = useForm();

const navigate= useNavigate();
  const submitHandler = (data) => {
    onSubmit(data);
  };

   const resetHandler=()=>{
        console.log("in reset");
        navigate('/fabrics');
   };
   return (
   <div className={classes.container}>
        <h2>Item Details</h2>
     <form  onSubmit={handleSubmit(submitHandler)} className={classes.form}>
    <table><tbody  className={classes.control}>
         <tr >
           <td><label className={classes.label} htmlFor="category">Category type</label></td>
           <td><input type="text" id="category" name="category"
              {...register("category", { required: "Category type is required." })}  /></td></tr>
  {errors.category && <tr><td></td><td colspan="2"><p className={classes.errorMsg}>{errors.category.message}</p></td></tr>}

        <tr>
           <td><label htmlFor="sub_category">Sub-category</label></td>
           <td><input type="text" id="sub_category" name="sub_category"
             {...register("sub_category", { required: "Category type is required." })}  /></td></tr>
  {errors.sub_category && <tr><td></td><td colspan="2"><p className={classes.errorMsg}>{errors.sub_category.message}</p></td></tr>}

        <tr><td><label htmlFor="type">Type</label></td>
           <td><input id="email" type="email" name="email"
         {...register("email", {
               required: "Type is required.",
               pattern: {
                 value: /^[^@ ]+@[^@ ]+\.[^@ .]{2,}$/,
                 message: "Email is not valid."}})}/></td></tr>
         {errors.email && <tr><td></td><td colspan="2"><p className={classes.errorMsg}>{errors.email.message}</p></td></tr>}

        <tr><td><label htmlFor="phone">Mobile</label></td>
            <td><input id="phone" type="phone" name="phone"
         {...register("phone", {
               required: "Mobile number is required."})}/></td></tr>
         {errors.phone &&  <tr><td></td><td colspan="2"><p className={classes.errorMsg}>{errors.phone.message}</p></td></tr>}
    </tbody>
    </table>
        <div className={classes.action}>
         <button type="reset" onClick={resetHandler} className="button button-flat">
           Cancel
         </button>
         <button  type="submit" className="button" disabled={isSubmitting}>
            Add
         </button>
        </div>
     </form>
    </div>
   );

}
export default FabricForm;
